import axios from 'axios';
import React from 'react';

const PersonasDetalle = (props) => {
    const submitDelete=()=>{
        
            axios.delete(`http://localhost:500/personajes/${props.personita._id}`)
            .then(()=>{
                alert('El registro se ha eliminado Correctamente');
                window.location.reload();
            })
            .catch((err)=>alert(`Ha ocurrido un error ${err}`));
    }

    return (
        <div>
            <div className="row">
                <div className="col s12 m6">
                    <div className="card cyan">
                        <div className="card-content white-text">
                            <span className="card-title"><strong>Nombre:{props.personita.nombre}</strong></span>
                            <p>Tipo:{props.personita.tipo}</p>
                            <p>Personalidad:{props.personita.personalidad}</p>
                            <p>caracteristicas: {props.personita.caracteristicas}</p>
                            <p>Gustos:{props.personita.gustos}</p>
                        </div>
                        <div className="card-action">
                            <button name="action" className="waves-effect red btn" onClick={submitDelete}>Eliminar</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default PersonasDetalle;
